  false,\n\t\"url\": null,\n\t\"notes\": \"Gridded multibeam bathymetry is integrated
  with bathymetry derived from multpectral World View-2 satellite data. Gridded (10
  m cell size) multibeam bathymetry collected aboard NOAA Ship Hiialaka'i and R/V
  AHI in 2007, a 224u0092 (68 m) United States National Oceanographic and Atmospheric
  Administration research ship. Bathymetry values shallower than ~20 m were derived
  by gauging the reletive attenuation of coastal, blue, green and yellow spectral
  radiance as a function of depth. A multiple linear regression analysis of coastal,
  blue, green and yellow band spectral values against depth determined the variables
  of y-intercept, coastal,blue, green and yellow slope values. Variables then used
  in multivariate slope intercept formula to derive depth. Digital image processing
  to derive depths conducted with the ENVI 4.8 software program while data editing
  and integration was performed using ArcGIS 10.1 This data set is for the shelf environment
  of Sarigan Island, Mariana.\",\n\t\"license_title\": null,\n\t\"extras\": [{\n\t\t\"key\":
